import React from "react";
import Grid from "@material-ui/core/Grid";
import ObraSocialForm from "./ObraSocialForm";
import { makeStyles } from "@material-ui/core/styles";

import ObraSocialTable from "./ObraSocialTable";
export default function ObraSocial() {
  const classes = useStyles();

  return (
    <Grid container>
      <Grid item xs={12} sm={6} md={6} lg={6} className={classes.listaOS}>
        <ObraSocialTable />
      </Grid>
      <Grid item xs={12} sm={6} md={6} lg={6} className={classes.borderForm}>
        <ObraSocialForm />
      </Grid>
    </Grid>
  );
}
const useStyles = makeStyles((theme) => ({
  headerOs: {
    textAlign: "center",
    paddingTop: 20,
  },
  borderForm: {
    borderLeft: "1px solid #000",
    height: "100%",
  },
  listaOS: {
    height: "100%",
  },
  itemObraSocial: {
    padding: 10,
    borderBottom: "1px solid #c4c4c4",
  },
}));
